import mongoose from "mongoose";
import GrazittiUser from "../models/grazittiUsers.models.js";

async function parseMembersData(membersArray) {
  const users = await Promise.all(
    membersArray.map(async (memberHtml) => {
      // Extract name
      let nameMatch = memberHtml.match(
        /<span class="user_name">([^<]+)<\/span>/
      );
      let name = nameMatch ? nameMatch[1].trim() : null;

      // Extract email
      let emailMatch = memberHtml.match(
        /<span class="user_email_value">([^<]+)<\/span>/
      );
      let email = emailMatch ? emailMatch[1].trim() : null;

      // Extract reporting manager
      let managerMatch = memberHtml.match(
        /<span class="reporting_manager_name">(?:-- )?([^<]+)?(?: --)?<\/span>/
      );
      let reporting_manager =
        managerMatch && managerMatch[1] && managerMatch[1] !== "Not Added"
          ? managerMatch[1].trim()
          : null;

      // Save to MongoDB
      const newUser = new GrazittiUser({
        name,
        email,
        reporting_manager,
      });
      await newUser.save();

      return { name, email, reporting_manager };
    })
  );

  return users;
}

// Usage example
async function main(data) {
  try {
    // Connect to MongoDB first
    await mongoose.connect("mongodb://127.0.0.1:27017/knowledge_manager");

    console.log("MongoDB connected");
    const structuredData = await parseMembersData(data);
    console.log(structuredData);

    mongoose.disconnect();
  } catch (err) {
    console.error(err);
  }
}

main(data);
